int opRxOutputTable_load(netsnmp_cache *cache, void *vmagic)
{
	struct opRxOutputTable_entry entry;
	int ret=0, i;
	snmp_RxOutput_t *pinfo = NULL;
	int RxOutput_num;

	COMMIT_PENDING_ASSERT();

	/* Free All */

	opRxOutputTable_removeAllEntry();

	/* Load All */
	RxOutput_num = 1;
	/*alarms_num =ipc_snmp_alarm_num(&agent)*/
	if (RxOutput_num == 0){
		DBG_ASSERT(0, "RxOutput num is 0");
		return 0;
	}

	pinfo = &g_RxOutputInfo;
	
	#ifdef CONFIG_CATVCOM
	catvinfo_t *info = NULL;
	ipc_catvinfo_ack_t *pack = NULL;
	pack = ipc_catv_config(ipc_fd, IPC_CONFIG_GET, IPC_APPLY_NONE, NULL);
	if(pack && pack->hdr.status == IPC_STATUS_OK) 
	{		
		info = &pack->catvinfo;
		#if defined(CONFIG_ZBL_SNMP)
		pinfo->OutputLevel = info->output_level;
		#else
		strncpy(pinfo->OutputLevel, info->output_level, sizeof(info->output_level));
		pinfo->OutputLevel_len = sizeof(pinfo->OutputLevel);
		#endif		
		if(pack)
		{
			free(pack);
		}
	}
	else
	{	
		if(pack)
		{
			free(pack);
		}		
		DEBUGMSGTL((DBGTOKEN,"snmp get input_laser_power from master fail!\n"));
		return SNMP_ERR_GENERR;
	}
	#endif

	for (i = 0; i < RxOutput_num; i ++)
	{
		opRxOutputTable_setEntry(&entry, &pinfo[i]);	
		opRxOutputTable_createEntry(&entry);	
	}

safe_exit:
	HC_IPC_ASSERT(ret);
	
    return ret; 
} 


